    <script>
        document.addEventListener("DOMContentLoaded", function() {
            var printButton = document.getElementById("printButton");

            printButton.addEventListener("click", function() {
                var printContent = document.getElementById("tabla-completa").outerHTML;
                var printWindow = window.open('', '', 'width=800,height=600');
                printWindow.document.write('<html><head><title>Corte de caja</title></head><body>');

                // Encabezado
                printWindow.document.write('<div style="text-align: center; margin-bottom: 20px;">');
                printWindow.document.write('<img style="width: 35%" src="' + "data:image/png;base64," + '" alt="Logo" style="max-width: 100%; height: auto;" />');
                printWindow.document.write('</div>');
                
                // Estilos de la pantalla
                printWindow.document.write('<style>table { border-collapse: collapse; width: 100%; } th, td { border: 1px solid #ddd; padding: 8px; text-align: left; } th { background-color: #f2f2f2; } tr:nth-child(even) { background-color: #f2f2f2; }</style>');
                
                // Estilos de la impresin
                printWindow.document.write('<style type="text/css" media="print"> \
                    body { font-family: Arial, sans-serif; } \
                    table { width: 100%; border-collapse: collapse; margin-bottom: 10px; } \
                    th, td { border: 1px solid #ddd; padding: 8px; text-align: left; } \
                    th { background-color: #f2f2f2; } \
                    tr:nth-child(even) { background-color: #f2f2f2; } \
                    @page { margin: 1cm; } \
                </style>');

                printWindow.document.write(printContent);

                // // Pie de pgina
                // printWindow.document.write('<div style="text-align: center; margin-top: 20px;">');
                // printWindow.document.write('');
                // printWindow.document.write('</div>');

                printWindow.document.write('</body></html>');
                printWindow.document.close();
                printWindow.print();
            });
        });
    </script>

